"Magnit delivery" is an application for home delivery of groceries from Magnit. For residents of Moscow and Krasnodar. Magnit is now at your home!

In the application:
• no more heavy packages – we will bring purchases directly to the door and hand them over without contact;
• we will select goods as for ourselves. And if something is out of stock – we will offer a worthy replacement!

In the new application "Magnit Delivery" you can:
• order groceries from 5,000 names with home delivery in Moscow and 25,000 names with home delivery in Krasnodar
• pay for the order by card in the application;
• register and store order history;
• receive push notifications with order status;
Also you can set up notifications, read privacy policies and contact support in personal account.

Delivery terms in Moscow:
• within 60 minutes within the MKAD;
• daily from 8:00 to 22:00;
• delivery cost from 49 rubles and free for orders over 999 rubles;
• weight limit – 30 kg.

Delivery terms in Krasnodar:
• after 3 hours at the same day, or at 60 min time interval 
• daily from 10:00 to 22:00;
• minimum order amount is 500 rubles;
• delivery cost 199 rubles and free for orders over 3000 rubles; 
• weight limit – 50kg.

Merry KItchen- кулинарная социальная сеть для быстрого и легкого поиска рецептов из продукции, которая есть у Вас дома. Скачай приложение и попробуй, как это просто! 

Это прекрасный выбор для тех, кто хочет разнообразить свое ежедневное меню, ищет, что приготовить на ужин, хочет удивить себя или близких новым блюдом как начинающий поваренок или шеф-повар.

В чем суть приложения «MerryKitchen»? Согласитесь, у каждого из нас возникала ситуация, когда хочется приготовить на ужин или обед что-то необычное, не банальное, а фантазия куда-то пропала. И вот, мы открываем интернет, ищем самые оригинальные рецепты, чтобы поесть, и видим что-то из разряда «вам потребуется фенхель, авокадо, курица и филе лосося». Естественно, что таких продуктов каждый день в доме у нас нет, а идти лишний раз в магазин за покупками нет средств или времени. И что мы тогда делаем в такой ситуации? Правильно, варим привычные для нас гречку, макароны, делаем что-то из картофеля и прощаемся с желанием вкусно разнообразить наше меню. Но теперь вы сможете победить такую проблему! Просто скачайте наше приложение «MerryKitchen» и выбирайте те блюда на день или неделю, которые будут состоять из продуктов в вашем холодильнике.

Наше приложение - это первая кулинарная социальная сеть, где вы сможете заполнить функцию «Мой холодильник». Благодаря ей вы внесете все продукты, которые есть у вас дома, и приложение сможет подобрать по ним легкие и простые рецепты на каждый день, которые выставили другие пользователи, с фото или без. Это может быть как выпечка, так и разнообразные виды салатов, тортов, каши, супы и так далее.

Тут вы сможете искать лучшие полезные блюда, что можно приготовить на завтрак, обед и ужин, добавлять их в избранное, чтобы не потерять, а также делиться своими рецептами с другими пользователями приложения. Вам доступны ежедневные и праздничные, новогодние и для похудения, ПП рецепты (правильное питание). Чтобы найти, что готовить, вам нужно:
1. Определиться с категорией, которую мы готовим дома:
- завтраки;
- быстрые типы закусок;
- разнообразные виды салатов;
- основное блюдо;
- гарниры;
- супы;
- выпечка;
- заготовки;
- соусы;
- напитки;
- десерты.
2. Выбрать спецификацию рецепта:
- веганский;
- безлактозный;
- постный;
- безглютеновый;
- сыроедческий;
- вегетарианский;
- без сахара;
- низкокалорийный (детское или правильное питание);
- подходит для детей.
3. Потом выбрать способ приготовления:
- сварить;
- пожарить;
- в духовке (например, для тортов);
- в микроволновке (печи свч);
- в мультиварке (есть рецепты для мультиварки, например, Redmond);
- в пароварке (на пару или в скороварке);
- на гриле;
- консервация;
- сушка;
- без термообработки;
- тушить и другое.
4. И указать желаемую кухню стран мира:
- европейская;
- азиатская;
- американская;
- арабская;
- африканская;
- индийская;
- испанская;
- итальянская;
- кавказская;
- мексиканская;
- русская;
- средиземноморская;
- узбекская;
- разная еда.

Также вы можете указать время приготовления и калорийность готового блюда. Ставьте отметку только домашние «Продукты из холодильника» или «Допускать дополнительные ингредиенты», если не против докупить продуктов на завтрак, обед и ужин в случае необходимости. После проведения таких несложных махинаций нажимайте на «Показать список рецептов» и программа выдаст вам очень вкусные и простые рецепты по вашим продуктам и пожеланиям для детей или взрослых.

Разные виды салатов, тортов, супы, каши, выпечка, мясо, пицца, мороженое — готовьте, что пожелаете.

Просматривайте фото и видео рецептов, пошаговые инструкции, создавайте свои собственные кулинарные шедевры и кушайте вкусную, а главное — разнообразную пищу каждый день! Попробуйте скачать наше приложение прямо сейчас и внесите в свое ежедневное меню новые кулинарные рецепты! Готовьте вкусно и быстро на скорую руку! Наше приложение — это лучше, чем кулинарная книга на русском без интернета (офлайн). То, что я люблю!
